import React from 'react'

class LoggedIn extends React.Component {
    state = {
        check: null
    }

    componentDidMount = () => {
        fetch("/api/check")
            .then(res => res.json())
            .then(check => {
                this.setState({check})
            })
    }

    render() {
        return (
            <ul className="navbar-nav navbar-right l-space">
                <li className="nav-item">
                    <a href="/users" className="nav-link">Profile</a>
                </li>
            </ul>
        )
    }
}

export default LoggedIn
